(548, 'WAWAN-1', 'Camel', 'مكمل الجمل، اسم على مسمى، مكمل ما قبل التمرين الاستثنائي من واوان نيوترشن المصمم خصيصاً للأبطال\n\nيحتوي على جميع المغذيات لطاقة أفضل-\n\nيعمل على زيادة القوة و البمب في العضلة لأنه معزز بالسيترولين مالات-\n\nزيادة مستوى التركيز-\n\nمدعم بالأحماض الأمينية و ل-كارنتين لتحويل الدهون الى طاقة-\n\n\n\nWawan Camel was formulated to deliver the most complete pre-workout supplement available.  Based on the latest scientific studies, it includes a vast array of ingredients in optimized dosages, all of which are vegetarian-friendly and Halal approved.', 'Watermelon,Pineapple', '', '', 78, 45, 45, 27, 290, '15', '246.5', '0', '189', '189', '57.5', '60462e9d4e144.jpeg', 0, 0, 3, 0, 0, '2021-03-08 18:03:09', '2021-07-17 22:02:23'),
(549, 'WAWAN-2', 'Karbolyn- Fruit', 'كاربولين واوان المصنع من أحدث المعادلات المطورة لتحفيز الانسولين . يعتبر الكاربولين من افضل انواع الكاربوهيدرات لزيادة حجم العضل و لامتصاص اسرع \n\nيحتوي على 50 غم من الكربوهيدرات في السكوب الواحد الخالي من السكر و الدهون - \nخفيف على المعدة و لا يسبب انتفاخات - \nمعدل امتصاص سريع - \nخال من الدهون و السكر - \n \n\nKarbolyn®️ from Wawan Nutrition is made up of the latest and most advanced formula to stimulate insulin. It is considered to be one of the finest types of carbohydrates to increase muscle size and fast absorption.', '', '', NULL, 78, 45, 45, 27, 351, '14', '301.86', '0', '230', '230', '71.86', '60463249dfb3f.jpeg', 0, 0, 3, 0, 0, '2021-03-08 18:18:50', '2021-03-17 17:53:55'),
