(565, 'Mega Vitamins', 'Mega Vitamins', 'ميغا فيتامين مكمل الفيتامينات مع تركيبة مطورة تشمل ٣٠ عنصر فعال لتزويد الجسم بالفيتامينات و المعادن و مضادات الاكسدة و الخمائر\n\n  ٤ كبسولات حصة يومية مع تركيبة صممت لدعم صحة جسمك لتقدم أفضل أداء خلال يومك\n\n٣٠٠  مغ مغنيسيوم من ستيريت المغنيسيوم بدون استخدام اكسيد المغنيسيوم لضمان أفضل امتصاص و وفرة بالجسم مقارنة بالمنتجات المنافسة\n٣٠٠ مغ فيتامين سي و الذي بزيادة نسبته بالمنتج تزيد نسبة امتصاص المغذيات\nمزود ب بكتيريا نافعة بكبسولات مغطاة تضمن وصولها للامعاء بدون تحللها في المعدة و خمائر طبيعية تحسن من الهضم و تدعم جهاز المناعة و تحسن نسبة العضل للدهون\n \n\nFormulated with 30 active ingredients to provide the body with vitamins, minerals and antioxidants!\nCapsules containing the highest-quality ingredients, which guarantees you a healthy body that can go through the toughest exercises!', '', '', NULL, 78, 45, 45, 27, 225, '20', '180', '0', '130', '130', '50', '604e1e50b06c9.jpeg', 0, 0, 3, 0, 0, '2021-03-14 18:31:45', '2021-03-17 17:50:26'),
(566, 'Omega 3', 'OMEGA 3', 'أوميغا3 من  واوان   هو منتج صحي مكون من خلاصات طبيعية تحتوي على ال\nEPA و ال DHA\n\nهذا المكمل الرائع  يعمل على\n\nزيادة فعالية القلب و الدماغ-\n\nالوقاية من التهاب المفاصل-\n\nتحسين  دعم المناعة بشكل عام-\n\nالمساعدة في بناء العضل و تسريع استشفاء الانسجة العضلية بعد التمارين الشاقة-\n\nطريقة الاستخدام: كبسولة واحدة مرتين يومياً مع الأكل\n\nWawan’s Omega 3 is a healthy product that consists of natural extracts and contains both docosahexaenoic acid (DHA) and eicosapentaenoic acid (EPA). Omega-3 fatty acids:\n\nincrease the efficiency of the heart and brain\nhelp with arthritis\nincrease resistance to diseases\nhelp build muscle and accelerate tissue recovery after vigorous exercise\nDirections of Use:\nOne capsules twice daily with food.', '', '', NULL, 78, 45, 45, 27, 189, '5', '179.55', '0', '110', '110', '69.55', '604e1f06b84c3.jpeg', 0, 0, 3, 0, 0, '2021-03-14 18:34:47', '2021-03-17 17:50:04'),
(567, 'LEUCINE', 'LEUCINE', '', '', '', NULL, 78, 45, 45, 27, 265, '16', '222.6', '0', '170', '170', '52.6', '604e202640790.jpeg', 0, 0, 3, 0, 0, '2021-03-14 18:39:34', '2021-03-17 17:49:44'),
(568, 'Takmeem', 'Takmeem', 'واوان نيوترشن يقدم تكميم بلاك، مكمل لانقاص الوزن، مصنوع من خليط من الاعشاب الاستوائية لزيادة معدل الحرق و التحكم بالشهية.\n\nمزود بالكافيين (200 ملجم) لزيادة النشاط.\n\nمعزز بفيتامين ب6 و ب12 لتقوية المناعة.\n \n\nطريقة الاستخدام: \nتناول كبسولتين يومياً مع كوب صغير من الماء.\n\n \n\nWawan Nutrition introduces Takmeem Black, a weight loss supplement, made with a mixture of tropical herbs to increase the fat burning rate and control appetite, with added caffeine (200 mg) to increase energy! Also enriched with Vitamins B6 & B12 to strengthen the immune system.\n\nDirections of Use:\nTake 2 capsules daily with a small glass of water.', '', '', NULL, 78, 45, 45, 27, 290, '15', '246.5', '0', '190', '190', '56.5', '604e2137811b2.jpeg', 0, 0, 3, 0, 0, '2021-03-14 18:44:08', '2021-03-17 17:49:27'),
(569, 'I Move', 'I Move', 'مكمل يدعم صحة المفاصل و الغضاريف و الاربطة , و الذي يساعد على مقاومة الالتهابات و الاصابات التي قد تحدث بعد التمرين القاسي و الطويل .\nيسرع ترميم الاربطة المتآكلة و يعالج خشونة المفاصل\n\nI MOVE supports the health of the joints, which helps to fight infections and injuries that may occur after severe and prolonged exercise.\nIt accelerates the restoration of eroded ligaments and treats joint pain.', '', '', NULL, 78, 45, 45, 27, 225, '20', '180', '0', '125', '125', '55', '604e21f4e2967.jpeg', 0, 0, 3, 0, 0, '2021-03-14 18:47:18', '2021-03-17 17:49:08'),
