(1, 'Al Rigga Football Pitch', 23, 'Pitch@mailinator.com', 'Al Marfa - Abu Dhabi - United Arab Emirates', 'Dubai', 24.116944751185162, 53.4608590265681, '1311313131', '10', '466994download.jpg,588764db.jpg,355163comnatenaiglowspinart.jpg', 'available', 0, '1,3,4,5', 'The person is not picking up his phone for bookings and it is very irritating, since I have it make a booking as soon as possible.', NULL, 0, 1, NULL, '2020-02-20 19:05:36', ''),
(2, 'Athletic Sports Academy- ملعب أكادمية أثليتك', 24, 'athleticsportsfujairah@gmail.com', 'Al Ittihad - Al Owaid Rd - Fujairah - United Arab Emirates', 'Fujairah - الفجيرة', 25.123362888237143, 56.33005276892012, '971529902200', '0', '38128020190708_163103.jpg,30990820190708_163125.jpg,28283720190708_163157.jpg,54473220190708_163237.jpg,68373620190708_163319.jpg,40489220190708_163516.jpg,48950620190708_163643.jpg', 'unavailable', 1, '11,18,19', '0', NULL, 3, 0, NULL, '2021-10-04 14:54:51', ''),
(3, 'United Football Club', 25, 'unitedfcfujairah@gmail.com', 'Fujairah - United Arab Emirates', 'Fujairah', 25.111519562636733, 56.35650616116875, '0581603658', '2013', '75796320190708_170509.jpg,69173120190708_170622.jpg,20364620190708_170647.jpg,31408020190708_170744.jpg,11606920190708_170757.jpg,42059220190708_170831.jpg,23640620190708_171047.jpg,80146120190708_171126.jpg,20970120190708_171217.jpg,22840120190708_174353.jpg,89502020190708_174411.jpg,95961820190708_174528.jpg,79161620190708_175514.jpg,93614820190708_175532.jpg', 'available', 0, '6,8,9,11,12,13,14,15,16,19', 'United Football Club is one of the best football pitches to play at for its pristine location. Right next to the beach, it gives the players the warm breeze of the ocean and lets players enjoy not only the game but nature itself. United Football Club also has a game station where kids and adults can play console games if they are trying to avoid getting sweaty. And while at it, try out their Foodstation as well that offers amazing dishes!', NULL, 0, 1, NULL, '2020-08-12 10:30:56', ''),
(4, 'Al Forsan Football Club Sharjah', 26, 'alforsansharjah@gmail.com', 'Tasjeel Auto Village, - Near Free Zone - Sharjah - United Arab Emirates', 'Sharjah', 25.336611289321688, 55.46990106446356, '0558933444', '2015', '', 'unavailable', 1, '6,8,9,11,15,16,19', 'Al Forsan is located near the Emirates Auction, so if you feel like buying a car for yourself, why not try to go to Al Forsan along the way and get sweaty with other players! Not only that it offers state of the art pitches, it also has everything a player needs from the ground like changing rooms, toilets, mosque, etc! it is definitely one of the places to go to for football.', NULL, 0, 1, NULL, '2020-01-14 02:53:01', ''),
(5, 'FootBox Sports Playgrounds', 27, 'footboxuaq@gmail.com', 'Unnamed Road - Umm Al Quwain (Umm Al Qiwain) - United Arab Emirates', 'Um Al Quwain', 25.486616287738315, 55.57876504411721, '0559559933', '2017', '35375620190710_185129.jpg,38414420190710_185159.jpg,15037320190710_185251.jpg,76940120190710_185314.jpg,70297720190710_185516.jpg,87147420190710_185543.jpg,72612720190710_185605.jpg,59087420190710_185743.jpg,97340720190710_185802.jpg,76464720190710_185943.jpg', 'available', 0, '6,8,9,11,15,18,19', 'Being a quiet place doesn', NULL, 0, 1, NULL, '2020-08-12 10:31:01', ''),
(6, 'Jamahir Football Club', 28, 'jamahirfcfujairah@gmail.com', 'Corniche Rd - Fujairah - United Arab Emirates', 'Fujairah', 25.109567243077258, 56.356705938943676, '0505221600', '2015', '12660620190708_175628.jpg,19610120190708_175645.jpg,21920620190708_175652.jpg,79358320190708_175713.jpg,86270720190708_175726.jpg,12788820190708_175734.jpg,93626220190708_175754.jpg,26044820190708_175815.jpg', 'available', 0, '6,8,9,11,13,15,19', 'Jamahir is one, if not, the nicest location to play football in Fujairah. Located right in the shores of Corniche Road beach, it has multiple pitches that players will love to try at, and they also have a cafeteria that offers great food! Right along the road is an amusement park for the family to enjoy while the rest of them play football! it is a must try football pitch in Fujairah for sure!', NULL, 0, 1, NULL, '2020-08-12 10:31:05', ''),
(7, 'Al Khan Beach Stadium', 29, 'alkhanfcsharjah@gmail.com', 'Unnamed Road - Sharjah - United Arab Emirates', 'Sharjah', 25.330464881277155, 55.355857247499394, '0564328020', '2017', '', 'available', 0, '6,11,19', 'Sun kissed, ocean breeze, sweaty palms, beach vibes and football. What\'s not to like? If not the closest football pitch near the beach, the location is just next level for this football ground, get those work stress with you and sweat it out while watching the scenic view of the sunset and go back feeling rejuvenated instead of being tired. This Sharjah football pitch is for sure, one-of-a-kind.', NULL, 0, 1, NULL, '2020-08-12 10:31:09', ''),
(8, 'Al Tanafus Sports Management', 30, 'altanafusfc@gmail.com', 'شارع الحميدية - Ajman - United Arab Emirates', 'Ajman', 25.400978408917656, 55.52684574356915, '0557667888', '2012', '578069whatsappimage20190822at1338141j.jpg,512962whatsappimage20190822at133814j.jpg,710261whatsappimage20190822at133815j.jpg', 'available', 0, '6,8,9,11,13,15,16,19', 'Located in Ajman, it is one of the football pitches where there is more than just playing that the ground offers, it is home to the best academies around to tech your kids the fundamentals of playing the sport. It also is located near the city and is very accessible to a lot of parents to drop off their kids and do groceries at the same time. Al Tanafus is a must visit place to play football and do other things alike, it is, a sports park anyway!', NULL, 0, 1, NULL, '2020-08-12 10:31:12', ''),
(9, 'Gulf Heroes Sports Center', 31, 'gulfheroessc@gmail.com', '12th St - Dubai - United Arab Emirates', 'Dubai', 25.22062988701589, 55.409181347106134, '0569766007', '2016', '', 'available', 0, '6,8,9,11,15,16,19', 'Gulf Heroes is located in Mirdif and is one of the most well maintained grounds there is. It has a lot of academies that kids can attend to and learn how to play football. They also have one of the best laid artificial grass in all pitches in Dubai. Also in a very strategic location, near villas and City Center Mirdif, this definitely is one football pitch you\'ll never get tired of visiting.', NULL, 0, 1, NULL, '2020-08-12 10:31:16', ''),
(10, 'أكاديمية الألعاب الرياضية', 34, 'add@mailinator.com', 'Fujairah - United Arab Emirates', 'Fujairah', 25.12724677243263, 56.335418317601714, '0000000000', '10', '754955astro_park0.jpg', 'unavailable', 1, '6,8,20,21', 'المربى المذهل في وسط المدينة ، لا يوفر ملعب كرة القدم هذا ملعبًا لكرة القدم فحسب ، بل يوفر أيضًا الترفيه للمقيمين بالقرب من الملعب. كما يضم ملعبًا لكرة السلة حيث يمكن للأطفال من جميع مناحي الحياة اللعب. إنها بالتأكيد واحدة من الأماكن التي يمكن ممارستها في الفجيرة للعب كرة القدم.', NULL, 3, 1, NULL, '2019-12-25 11:20:03', ''),
